import React from 'react';

function Zipper() {
  return (
    <div className='zipper-container'>
      <div>
        <p>Test</p>
      </div>
      <hr></hr>
      <div>
        <p>Test</p>
      </div>
    </div>
  )
}



export default Zipper;
